import React, { Component } from "react";
import "./index.css";


class NavigationCorps extends React.Component {
  render() {
    return (
     <div>
    <div class="container-fluid">
        <div class="row">
          <div class="col-lg-8 col-md-8 col-sm-8 col-xs-8"> 
          </div>
          <div class="col-lg-4 col-md-4 col-sm-4 col-xs-4">
            <a href="#" class="w3-btn w3-black">Jeanne</a>
            <a href="#" class="w3-btn w3-black">Martine</a>
            <a href="#" class="w3-btn w3-black">Claude</a>
          </div>
        </div>
      </div>
    </div>
    );
  }
}

export default NavigationCorps;
